import React from 'react'
import styled from "styled-components";
import myimage from "./images/download.jpg";


function Testiminials() {
    return (
        <div>
            <div>
          <h1>HIDING IN PLAIN SIGHT</h1>
          <P>
            With a small footprint and elegant design, The Mirror blends
            seamlessly into your home. All you need is two feet of wall space to
            turn any room into a complete home gym.With a small footprint and
            elegant design, The Mirror blends seamlessly into your home. All you
            need is two feet of wall space to turn any room into a complete home
            gym.
          </P>
          <button type="button" class="btn btn-dark">
            HOW IT WORKS
          </button>
        </div>

        <div>
          {" "}
          <IMG src={myimage} alt="testinomials.png"></IMG>
        </div>
        </div>
    )
}

export default Testiminials


const TestWraper = styled.div
`
  display: flex;
  align-items: center;
  width: auto;
  padding: 10%;
`;
